eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n// Module\nvar code = \"<h1 id=\\\"webpack-是做什么的\\\">webpack 是做什么的</h1>\\n<h2 id=\\\"定义\\\">定义</h2>\\n<p>webpack 是一个现代的打包模块化的 JavaScript 工具。它就是用来打包的。</p>\\n<h2 id=\\\"流程\\\">流程</h2>\\n<p>在 webpack 中一切文件（JavaScript、CSS、SCSS、图片）皆模块，在内部通过 Loader 转换文件，通过 Plugin 注入钩子，最后输出由多个模块组合成的文件。</p>\\n<h2 id=\\\"webpack-的优点\\\">webpack 的优点</h2>\\n<ul>\\n<li>社区庞大且活跃，在前端发展速度如此快的今天，可以很快找到最新的 Plugin；</li>\\n<li>使用场景不限于 Web 开发；</li>\\n</ul>\\n<h2 id=\\\"构建\\\">构建</h2>\\n<pre><code class=\\\"language-shell\\\">npm i webpack webpack-cli -D\\n</code></pre>\\n<h2 id=\\\"配置\\\">配置</h2>\\n<h3 id=\\\"默认配置\\\">默认配置</h3>\\n<p>自从<code>webpack4</code>开始，<code>webpack</code>支持 0 配置的方式，它的默认入口文件是<code>src/index.js</code>，默认出口文件是<code>dist/main.js</code>。如想要自定义 需 在根目录下创建一个<code>webpack.config.js</code>文件，来自定义这些配置。</p>\\n<h3 id=\\\"自定义配置\\\">自定义配置</h3>\\n<p>在根目录中创建<code>webpack.condfig.js</code> 进行配置，其遵循<code>CommonJS</code>模块化规则。</p>\\n<pre><code class=\\\"language-cjs\\\">const path = require(&#39;path&#39;);\\nmodule.exports = {\\n  // 入口文件\\n  entry: &#39;./src/main.js&#39;,\\n  // 出口配置\\n  output: {\\n    // 配置出口文件名\\n    filename: &#39;index.js&#39;,\\n    // 文件输出目录，必须是绝对目录\\n    path: path.join(__dirname, &#39;output&#39;)\\n  }\\n};\\n</code></pre>\\n<h3 id=\\\"工作模式\\\">工作模式</h3>\\n<p>工作模式可以通过命令行<code>—mode</code> 字段配置。</p>\\n<ul>\\n<li><code>none</code>：不会进行代码的优化操作，可读性最高，打包速度最快</li>\\n<li><code>production</code>：默认值，该模式会对代码进行压缩</li>\\n<li><code>development</code>：自动优化打包速度，添加一些调试过程的辅助</li>\\n</ul>\\n<h3 id=\\\"资源模块\\\">资源模块</h3>\\n<ul>\\n<li>除了 js 文件之外，我们还可以通过 <code>Loader</code> 加载任意类型的的资源模块</li>\\n<li><code>Loader</code>是<code>webpack</code>的实现整个前端模块化的核心，通过加载不同的<code>loader</code>，从而可以实现任意类型资源的加载。</li>\\n</ul>\\n<h4 id=\\\"css-资源\\\">css 资源</h4>\\n<p>要注意的是 他会将 <code>css</code> 也打包到 <code>js</code> 中，不会产生 <code>css</code> 文件。</p>\\n<pre><code class=\\\"language-shell\\\">npm i style-loader css-loader -D\\n</code></pre>\\n<pre><code class=\\\"language-cjs\\\">const path = require(&#39;path&#39;);\\nmodule.exports = {\\n  mode: &#39;none&#39;,\\n  entry: &#39;./src/main.js&#39;,\\n  output: {\\n    filename: &#39;index.js&#39;,\\n    path: path.join(__dirname, &#39;dist&#39;)\\n    // publicPath 用于表示资源的打包后的资源前缀，默认为空\\n  },\\n  module: {\\n    rules: [\\n      {\\n        // 模块的匹配规则\\n        test: /.css$/,\\n        // 从后往前执行，每一项都是一个loader\\n        use: [&#39;style-loader&#39;, &#39;css-loader&#39;]\\n      }\\n    ]\\n  }\\n};\\n</code></pre>\\n<h4 id=\\\"图片资源\\\">图片资源</h4>\\n<p>使用<code>url-loader</code> <code>file-loader</code> 配合来处理图片资源。增加一个新的 loader</p>\\n<pre><code class=\\\"language-shell\\\">npm i url-loader file-loader -D\\n</code></pre>\\n<pre><code class=\\\"language-javascript\\\">{\\n  test: /\\\\.(png|jpe?g|gif)$/i,\\n  use: {\\n    loader: &#39;url-loader&#39;,\\n    options: {\\n      // 小于这个值的通过url-loader，转换为DataURL，否则使用file-loader\\n      limit: 10 * 1024\\n    }\\n  }\\n}\\n</code></pre>\\n<h4 id=\\\"处理-es6\\\">处理 ES6+</h4>\\n<p>增加 babel <code>loader</code> 来解决, <code>babel</code> 只负责对语法进行编译。当我们写尖头函数，<code>babel</code> 会帮你把它编译成普通函数，这没有任何问题，但是，比如说我们代码里使用了<code>promise</code>，<code>babel</code>打包出来的代码其实还是<code>promise</code></p>\\n<pre><code class=\\\"language-shell\\\">npm i babel-loader @babel/core @babel/preset-env -D\\n</code></pre>\\n<pre><code class=\\\"language-javascript\\\">module.exports = {\\n  module: {\\n    rules: [\\n      {\\n        test: /.js$/,\\n        use: {\\n          loader: &#39;babel-loader&#39;,\\n          options: {\\n            presets: [&#39;@babel/preset-env&#39;]\\n          }\\n        }\\n      }\\n    ]\\n  }\\n};\\n</code></pre>\\n<h4 id=\\\"开发一个-loader\\\">开发一个 Loader</h4>\\n<p>Loader 作为 webpack 的核心机制，实现原理呢也比较简单，现在我们就来开发一款属于自己的 Loader。</p>\\n<ul>\\n<li>构建一个函数，这个函数接收文件内容。</li>\\n<li>对内容进行处理，然后返回</li>\\n<li>在 <code>rules</code> 中增加对 该文件的监听。</li>\\n</ul>\\n<h3 id=\\\"webpack-中常用的插件\\\">webpack 中常用的插件</h3>\\n<p>webpack 插件 配置在<code>plugins</code> 中。</p>\\n<ul>\\n<li>clean-webpack-plugin：可以帮助我们自动情况 dist 目录的插件；</li>\\n<li>html-webpack-plugin：自动生成使用打包结果的 HTML；</li>\\n<li>copy-webpack-plungin：将已经存在的单个文件或整个目录复制到构建目录。</li>\\n</ul>\\n<pre><code class=\\\"language-cjs\\\">plugins: [\\n    // 用于清空 dist 目录\\n    new CleanWebpackPlugin(),\\n    // 用于生成 index.html\\n    new HtmlWebpackPlugin({\\n      // 添加 title 属性，在 HTML 文件中通过 htmlWebpackPlugin.options.title 获取，采用 Lodash 模板语法书写\\n      title: &#39;Webpack Plugin Sample&#39;,\\n      // 添加一个 meta 元素，name 为 viewport content 为 width=device-width\\n      meta: {\\n        viewport: &#39;width=device-width&#39;,\\n      },\\n      // 使用哪个 HTML 文件作为模板\\n      template: &#39;index.html&#39;,\\n    }),\\n    // 生成多个页面 创建多个 HtmlWebpackPlugin 实例，用于生成 about.html\\n    new HtmlWebpackPlugin({\\n      // filename 默认为 index.html\\n      filename: &#39;about.html&#39;,\\n    }),\\n    // 拷贝不需要打包的内容\\n    new CopyWebpackPlugin([\\n      // &#39;public/**&#39;\\n      // 直接拷贝 public 下所有内容至输出目录\\n      &#39;public&#39;,\\n    ])\\n</code></pre>\\n<h3 id=\\\"其他技巧\\\">其他技巧</h3>\\n<h4 id=\\\"自编译\\\">自编译</h4>\\n<h5 id=\\\"方法1\\\">方法1</h5>\\n<pre><code class=\\\"language-cjs\\\">{\\n  watch: true, // 增加配置\\n}\\n</code></pre>\\n<h5 id=\\\"方法2\\\">方法2</h5>\\n<p>利用<code>webpack-dev-server</code>插件来完成</p>\\n<pre><code class=\\\"language-shell\\\">npm i webpack-dev-server -D\\n</code></pre>\\n\";\n// Exports\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (code);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///15\n");

